import React from 'react';
import Header from './Header';

const PersonalAreaMenu = () => {
    return (
        <div className="flex h-[700px]" >
            <div className="meny_personal_area border-r-2 border-gray w-[300px] h-fll py-14 px-8">
                <div className="a1 text-3xl text-bold mb-8" onClick={() => window.location.href='personal_area.html'}>Личный кабинет</div>
                <div className="a2 text-2xl mb-8" onClick={() => window.location.href='personal_area.html'}>Мои данные</div>
                <div className="a2 text-2xl mb-8" onClick={() => window.location.href='cart_edit.html'}>Способы оплаты</div>
                <div className="a2_activ text-2xl mb-8" onClick={() => window.location.href='purchases.html'}>Покупки</div>
                <div className="a2 mb-8 text-xl" onClick={() => window.location.href='delivery.html'}>Доставки</div>
                <div className="exit_pc text-xl" onClick={() => {}}>
                    <img src="svg/Logout 2.svg" alt="" />
                    <a>Выйти</a>
                </div>
            </div>
        </div>
    );
};

const Delivery = () => {
    return (
        <div>
            <div className="header_name_back">
                <a href="personal_area.html"></a>
                <a>Мои доставки</a>
            </div>
            <div className="flex">
                <div className="dilivery_block">
                    <div className="name_edit">
                        <a className="p1">Заказ от 18 марта</a>
                    </div>
                    <a className="p2">Доставка ожидается 20 марта</a>
                    <br />
                    <a className="p3">1 товар</a>
                    <div className="photo_name">
                        <img src="/photo_product/00001.png" alt="" />
                        <a className="name_pr">Лист гипсоволокнистый KNAUF <br /> Суперпол, 600*1200*20мм</a>
                    </div>
                    <div className="price">
                        <a>610 ₽</a>
                    </div>
                    <div className="status">
                        <a>Заказ оплачен</a>
                    </div>
                </div>
            </div>
            {/* Если нет то */}
            <div className="not_delivery hidden">
                <img src="img/Default_car_goods_delivery_stylish_illustration_3 1.png" alt="#" />
                <div className="text">
                    <a className="a1">Нет актуальных доставок</a>
                    <br />
                    <a className="a2">Закажите товары из каталога!</a>
                    <br />
                    <br />
                    <button className="gui" onClick={() => window.location.href='catalog.html'}>Перейти в каталог</button>
                </div>
            </div>
        </div>
    );
};

const PersonalAreaPage = () => {
    return (
        <>
            <Header/>
           <div className='flex h-full'>
           <PersonalAreaMenu />
            <Delivery />
           </div>
        </>
    );
};

export default PersonalAreaPage;
